import React from 'react';
import {BrowserRouter as Route, Router, Switch} from 'react-router-dom';
import Login from './components/login';
import Tabla from './components/Tabla';
function App() {


  return (
    <Router>
      <Switch>
        <Route path="/login">
            <Login />
        </Route>
        <Route path="/TeamEdit">
            <Tabla />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
